import React from 'react'
import './../../scss/style.scss';


const Content = (props) => {
    return(
        <main className='content'>
            <section className='content__block'>
                <div className='content__item'>
                    <img className='content__prod' />
                </div>
            </section>
        </main>
    )
}


export default Content
